This was created for someone who asked me if I had any Johnny Taylor songs. I completely forgot about this persons request in my attempt to find as many Johnnie Taylor songs as possible.

Mr. Taylor had quite a number of SOUL songs that always operated near the threshold of RAUNCHY. I mean it is something to hear the sexual implication in music given the time these songs were sung in. R Kelly has nothing on this guy. Nonetheless I have gathered up some of the popular albums of this man and hope you all enjoy it.

